import React, {Component} from 'react'
import 'bootstrap/dist/css/bootstrap.min.css'
import bgimg from '../img/error/gargantuabg.svg'
import deadman from '../img/error/deadman1.svg'
import junk from '../img/error/junk1.svg'
import junks from '../img/error/junks1.svg'
import Logo from '../parts/logo.jsx'
class ErrorPage extends Component {
    render() {
        return (
            <div style={bgimgStyle} className="container-fluid">
                <div className="row" style={{height: "100%"}}>
                    <div style={{height: "100%"}}> <img src={deadman} alt="man" style={imgStyle}/> </div>
                    <div className="col-12 position-absolute fixed-bottom"> <img src={junk} alt="junk" style={imgStyle}/> </div>
                    <div className="col-12 position-absolute fixed-bottom"> <img src={junks} alt="junks" style={imgStyle}/> </div>
                </div>
                <Logo />
            </div>
        )
    }}
const bgimgStyle = {
    background: 'url('+ bgimg +') no-repeat center top fixed',
    backgroundSize: 'cover',
    boxShadow: 'inset 0 0 50px #000',
    width: '100%',
    height: '100%'
}
const imgStyle = {
    width: '100%',
    bottom: '0'
}
    export default ErrorPage
